import logo from './logo.svg';
import './App.css';
import TotalsContainer from './totals-container';
import AveragesContainer from './averages-container';
import TabSwitchContainer from './tab-switch-container';

function App() {
  [tab, setTab] = React.useState("")

  return (
    <div className="App">
      <header className="App-header">
        <TabSwitchContainer onChange={setTab}>
          <TotalsContainer />
          <AveragesContainer />
          {tab}
        </TabSwitchContainer>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
